// ==UserScript==
// @name           Runescape Toolbar
// @namespace      Shaun Dreclin
// @include        *world*.runescape.com*
// ==/UserScript==

//Fonts by WolfieMario - http://fontstruct.com/fontstructors/wolfiemario - Fonts and images encoded by Spritebaker - http://www.spritebaker.com
var normalFontData = "data:font/ttf;base64,";
var boldFontData = "data:font/ttf;base64,";
var backgroundData = "data:image/png;base64,";
var iconData = "data:image/png;base64,";
var transparantData = "data:image/gif;base64,R0lGODlhAQABAJEAAAAAAP///////wAAACH5BAEAAAIALAAAAAABAAEAAAICVAEAOw==";

//AddCommas function by Keith Jenci - http://www.mredkj.com
function addCommas(nStr) {
	nStr += '';
	x = nStr.split('.');
	x1 = x[0];
	x2 = x.length > 1 ? '.' + x[1] : '';
	var rgx = /(\d+)(\d{3})/;
	while (rgx.test(x1)) {
		x1 = x1.replace(rgx, '$1' + ',' + '$2');
	}
	return x1 + x2;
}

//Jquery style document.getElementById
var $ = function(id) { return document.getElementById(id); }

//Create the toolbar, fill it with stuff
var rsToolbar = document.createElement('div');
document.body.appendChild(rsToolbar);
rsToolbar.id = "rsToolbar";
rsToolbar.innerHTML = '														\
	<input type="text" id="rsToolbarSearch" value="Search..." />			\
	<span id="rsToolbarItemName">Grand Exchange Search Toolbar</span>		\
	<img id="rsToolbarItemIcon" src="' + iconData + '" />					\
	<span id="rsToolbarItemValue"></span>									\
';

//Apply style
GM_addStyle("																\
	@font-face {															\
		font-family: runescape;												\
		src: url('" + normalFontData + "') format('truetype');				\
		font-weight: normal;												\
	}																		\
																			\
	@font-face {															\
		font-family: runescape;												\
		src: url('" + boldFontData + "') format('truetype');				\
		font-weight: bold;													\
	}																		\
																			\
	#rsToolbar {															\
		position: absolute;													\
		z-index: 100;														\
		left: 50%;															\
		width: 486px; height: 21px;											\
		padding: 7px;														\
		margin: -28px 0px 0px -251px;										\
		transition: margin-top 0.5s;										\
																			\
		background: url('" + backgroundData + "') #000 no-repeat;			\
		border-top: none;													\
		text-align: left;													\
	}																		\
																			\
	#rsToolbar:hover {														\
		margin-top: -1px;													\
	}																		\
																			\
	#rsToolbarSearch {														\
		width: 130px; height: 18px;											\
		border: 1px solid #312a1b;											\
		margin: 0px 5px 0px 1px;											\
		font-family: runescape;												\
		font-size: 16px;													\
		color: #444;														\
		background: #9d8d74;												\
	}																		\
																			\
	#rsToolbarItemName, #rsToolbarItemValue {								\
		position: relative;													\
		top: 1px;															\
		font-family: runescape;												\
		font-weight: bold;													\
		font-size: 16px;													\
		color: #cc9800;														\
		text-shadow: 1px 1px 0px #000;										\
		transition: opacity 0.5s;											\
	}																		\
																			\
	#rsToolbarItemValue {													\
		text-align: right;													\
		float: right;														\
	}																		\
																			\
	#rsToolbarItemIcon {													\
		width: 20px; height: 20px;											\
		float: right;														\
		margin: 0px 3px 0px 5px;											\
		transition: opacity 0.5s;											\
	}																		\
");

//Events for showing and hiding the "Search..." text
$('rsToolbarSearch').addEventListener("focus", function(e) { if($('rsToolbarSearch').value == "Search...") { $('rsToolbarSearch').value = ""; $('rsToolbarSearch').style.color = "#FFF"; $('rsToolbarSearch').style.textShadow = "1px 1px 0px #000"; } });
$('rsToolbarSearch').addEventListener("blur",  function(e) { if($('rsToolbarSearch').value == "") { $('rsToolbarSearch').value = "Search..."; $('rsToolbarSearch').style.color = "#444"; $('rsToolbarSearch').style.textShadow = "none"; } });

//Events for clicking Go and hitting enter in the text box
$('rsToolbarSearch').addEventListener("keypress", function(e) { if(e.keyCode == 13) { formSubmit(); } });

function formSubmit() {
	//Do calculations for the !calc command
	if($('rsToolbarSearch').value.substr(0, 6) == "!calc ") {
		//Hide the toolbar contents, wait to do math
		$('rsToolbarItemIcon').style.opacity = 0;
		$('rsToolbarItemName').style.opacity = 0;
		$('rsToolbarItemValue').style.opacity = 0;
		var calculation = $('rsToolbarSearch').value.substr(6);
		setTimeout(function () {
			$('rsToolbarItemIcon').src = iconData;
			$('rsToolbarItemName').innerHTML = calculation + " = " + addCommas(eval(calculation));
			$('rsToolbarItemValue').innerHTML = "";
			
			//Make the toolbar contents visible again
			$('rsToolbarItemIcon').style.opacity = 1;
			$('rsToolbarItemName').style.opacity = 1;
			$('rsToolbarItemValue').style.opacity = 1;
		}, 500);
	} else {
		//Hide the toolbar contents, request GE data
		$('rsToolbarItemIcon').style.opacity = 0;
		$('rsToolbarItemName').style.opacity = 0;
		$('rsToolbarItemValue').style.opacity = 0;
		setTimeout(function() { $('rsToolbarItemIcon').src = transparantData; }, 500);
		var itemName = $('rsToolbarSearch').value
		GM_xmlhttpRequest({
			method: "GET",
			url: "http://services.runescape.com/m=itemdb_rs/results.ws?query=" + escape(itemName),
			onload: function(response) {
				if(response.responseText.indexOf('<td class="item">') != -1) {
					//Results found, parse and display
					$('rsToolbarItemIcon').src = response.responseText.split('<td class="item">')[1].split('"')[1];
					$('rsToolbarItemName').innerHTML = response.responseText.split('<td class="item">')[1].split('"')[3];
					$('rsToolbarItemValue').innerHTML = response.responseText.split('<td class="price">')[1].split('<')[0];
					if(!/[kmb]/i.test($('rsToolbarItemValue').innerHTML)) { $('rsToolbarItemValue').innerHTML += "gp"; }
					
					//Exact match found, parse and display
					if(itemName.toLowerCase() != $('rsToolbarItemName').innerHTML.toLowerCase() && response.responseText.toLowerCase().indexOf(">" + itemName.toLowerCase() + "<") != -1) {
						var itemInfo = response.responseText.toLowerCase().split(">" + itemName.toLowerCase() + "<")[0];
						itemInfo = itemInfo.split('<td class="item">')[itemInfo.split('<td class="item">').length - 1];
						$('rsToolbarItemIcon').src = itemInfo.split('"')[1];
						$('rsToolbarItemName').innerHTML = itemInfo.split('"')[3].charAt(0).toUpperCase() + itemInfo.split('"')[3].slice(1);
						$('rsToolbarItemValue').innerHTML = response.responseText.toLowerCase().split(itemInfo)[1].split('<td class="price">')[1].split('<')[0];
						if(!/[kmb]/i.test($('rsToolbarItemValue').innerHTML)) { $('rsToolbarItemValue').innerHTML += "gp"; }
					}		
				} else {
					//No results or other error, show default toolbar contents
					$('rsToolbarItemIcon').src = iconData;
					$('rsToolbarItemName').innerHTML = "Grand Exchange Search Toolbar";
					$('rsToolbarItemValue').innerHTML = "";
				}
				
				//Make the toolbar contents visible again
				$('rsToolbarItemIcon').style.opacity = 1;
				$('rsToolbarItemName').style.opacity = 1;
				$('rsToolbarItemValue').style.opacity = 1;
			}
		});
	}

	//Empty the search text box
	$('rsToolbarSearch').value = "";
}
